export const getdataAction1 = (data)=>{
  return {
    type: "getdata",
    payload: data
  };
}

export const getdataAction = (data) => {
  return (dispatch,getState)=>{
  

      try {
        const response =  axios.get(data);
        dispatch(getdataAction1( response.data))
  
      } catch (error) {
        console.error(error);
      }
    }
  
 
};
